import React, { Component } from 'react';

class Product extends Component {
    render() {

        var {id, name, img, classc} = this.props;

        return (
        	<div>
        		<h1>
                	Hình ảnh của sinh viên {name}
            	</h1>
            	<div>
            		<div>
            			<div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">
            				<div class="thumbnail">
            					<img src = {img} alt={name}/>
            					<div class="caption">
            						<h3>Title</h3>
            						<p>
            							...
            						</p>
            						<p>
            							<a href="#" class="btn btn-primary">Đã có mặt</a>
            							<a href="#" class="btn btn-default">Nghi vấn</a>
            						</p>
            					</div>
            				</div>
            			</div>
            		</div>
            		<div></div>
            	</div>
        	</div>
         
        );
    }
}

export default Product;
